import {Link} from 'react-router-dom';
import {useState, useEffect} from 'react';
export default function Movements(){
    const [movements, setMovements] = useState([]);
    useEffect(()=>{
        fetch('/movements/api').then((result)=>result.json()).then((json)=>{
            console.log({json});
            setMovements(json);
        }).catch(console.log);
    }, []);
    return (<div>
        <h1>Movimientos:</h1>
    <div>
        {/*<button type="button" class="btn btn-primary btn-block">Editar</button>
        <br/>
        <button type="button" class="btn btn-primary btn-block">Eliminar</button>
        las llaves de aMovement pueden ir dentro de etiquetas html
        */}
        {movements.map(aMovement=><div>{aMovement.concept},{aMovement.amount}
        <button type="button" class="btn btn-primary btn-block" onClick={()=>{
            fetch()
        }}>Eliminar</button>
        </div>)}
    </div>
</div>)};
